intrinsic KummerRelationsMatrixSuperelliptic(f::RngUPolElt) -> Mtrx
{ Returns the matrix with rows the coefficients of each monomial in the ki for the 70 relations for the
Kummer embedding of the genus three superelliptic curve y^3 = f(x). }
    relations_matrix := KummerRelationsMatrixSuperelliptic();
    K<f0,f1,f2,f3,f4> := BaseRing(Parent(relations_matrix));
    Kf := BaseRing(Parent(f));
    
    f_coeffs := [Coefficient(f, i) : i in [0..4]];
    assert Degree(f) eq 4;
    the_hom := hom<K->Kf | f_coeffs>;

    relations_matrix_f := Matrix([[the_hom(relations_matrix[i][j]) : 
        j in [1..Ncols(relations_matrix)]] : i in [1..Nrows(relations_matrix)]]);
    return relations_matrix_f;
end intrinsic;


intrinsic KummerRelationsSuperelliptic() -> SeqEnum
{ Returns the polynomials corresponding to the Kummer relations matrix. }
    relations_matrix := KummerRelationsMatrixSuperelliptic();
    K<f0,f1,f2,f3,f4> := CoefficientRing(relations_matrix);

    Pk<k1,k2,k3,k4,k5,k6,k7,k8> := PolynomialRing(K, 8);
    monomials := DegreeNCombinations([Pk.i : i in [1..8]], 4);

    return [VectorToPolynomial(v, monomials) : v in Rows(relations_matrix)];
end intrinsic;


intrinsic KummerRelationsSuperelliptic(f::RngUPolElt) -> SeqEnum
{ Returns the polynomials corresponding to the Kummer relations matrix. }
    relations := KummerRelationsSuperelliptic();
    Pk := Universe(relations);
    K<f0,f1,f2,f3,f4> := BaseRing(Pk);
    Kf := BaseRing(Parent(f));
    Pkf := ChangeRing(Pk, Kf);

    f_coeffs := [Coefficient(f, i) : i in [0..4]];
    assert Degree(f) eq 4;

    the_hom := hom<Pk->Pkf | hom<K->Kf | f_coeffs>, [Pkf.i : i in [1..8]]>;
    return [the_hom(poly) : poly in relations];
end intrinsic;


intrinsic SpecialiseMatrix(M::Mtrx, spec_hom::Map) -> Mtrx
{ Given a map that can be applied to each entry of M, we specialise M by applying this map. }
    return Matrix([[spec_hom(M[i][j]) : j in [1..Ncols(M)]] : i in [1..Nrows(M)]]);
end intrinsic;


intrinsic SpecialiseMatrix(M::Mtrx, specialisations::SeqEnum) -> Mtrx
{ Given a matrix defined over a function field or multivariable polynomial ring in n variables, we
specialise the variables to the specialisations. Thus specialisations should be a list of length
equal to the rank of the coefficient ring of M. }
    K := CoefficientRing(M);
    Kspec := FieldOfFractions(Universe(specialisations));
    spec_hom := hom<K->Kspec | specialisations>;
    return SpecialiseMatrix(M, spec_hom);
end intrinsic;


intrinsic CheckKummerCoordinatesSuperelliptic(f::RngUPolElt) -> BoolElt
{ We check that the relations we find are correct on any specialisation. }

    relations := KummerRelationsSuperelliptic(f);

    kummer_coords_spec := KummerCoordinatesGenus3Superelliptic(f);

    Pk := Universe(relations);
    Q := Universe(kummer_coords_spec);
    evaluate_hom := hom<Pk->Q | kummer_coords_spec>;

    f_coeffs := [Coefficient(f, i) : i in [0..4]];

    reductions := [ReduceInFunctionFieldSuperelliptic(evaluate_hom(relation), f_coeffs) : relation in relations];
    return Set(reductions) eq { 0 };
end intrinsic;